import React, { Component } from 'react';
import ChartJs from '../../components/ChartJs';
import MoldePesquisa from '../../components/molde-barra-pesquisa';
import MoldeSide from '../../components/molde-sidebar/molde-sidebar';
import './style.css';


export default class Dashboard extends Component {
    render() {
        return (
            <div>
                <div>

                </div>



                    <div className="conteudo">


                        <div className="container">

                            <section className="conteudo__dash caixa">

                                <a href="#w" className="botao1 botao" >Visão geral</a>

                                <a href="#" className="botao2 botao" >Café da manhã</a>

                                <a href="#" className="botao3 botao">Almoço</a>

                                <a href="#abc" className="botao4 botao">Janta</a>

                                <a href="#awaw" className="botao5 botao">Gerar relatorio</a>


                                <div className="dashboard">
                                    <ChartJs />
                                </div>


                            </section>




                        </div>






                    </div>

                    

            </div>
        )
    }
}
